export function Footer(){
    return(
        <div>
            <input placeholder="Введите имя" type="text" />
            <input placeholder="Введите фамилию" type="text" />
            <input placeholder="Введите номер телефона" type="text" />
            <ButtonFooter>{children}</ButtonFooter>
        </div>
    )
}
